import React from 'react';
import { Link } from 'react-router-dom';

function CardItem(props) {
    return (
        <div className='take__actions'>
            <div className='events'>
                <div className='image'>
                    <img className='img'
                        src={props.src} />
                    <div clas='text-block'>
                        <h4 className='title'>{props.title}</h4>
                        <Button href="https://developers.google.com/community/dsc" className='btn' variant="contained">{props.text} </Button>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default CardItem;
